  /** 
  * {"synlig":"true","sporsmalstekst":"","bobletekst":"","seksjonstekst_overskrift":"Andre krav og tilleggsutgifter","seksjonstekst_brodtekst":"<h3>Kost</h3>     \n<p> Hvis du har vært på reise mer enn 12 timer, kan du ha rett til å få kostgodtgjørelse. Kost dekkes med en fast sats. Husk å legge inn antall døgn du søker kostgodtgjørelse for. </p>    \n\n<h3>Overnatting</h3>     \n<p> Når helsetilstanden din eller lang reisevei gjorde det nødvendig med overnatting på reisen, kan overnattingskostnader dekkes med en fast sats. Overnatting på grunn av helsetilstand må dokumenteres av behandler. Du må laste opp kvitteringer for overnattingskostnadene. Privat overnatting dekkes ikke. </p>    \n\n<p> Hvis du har hatt flere etterfølgende behandlinger, kan du velge å overnatte i nærheten av behandlingsstedet i stedet for å reise hjem mellom behandlingene. Da kan du få dekket utgifter til kost og overnatting inntil hva det ville kostet å reise frem og tilbake. I feltet for begrunnelse må du skrive inn opplysninger om reisene mellom oppholdsstedet og behandlingsstedet. Du må legge inn samlet beløp for kost, overnatting og reiser mens du oppholdt deg i nærheten av behandlingsstedet.</p>    \n\n<h3>Forsendelse av reisegods</h3>     \n<p> Du kan ha rett til å få dekket utgifter til forsendelse av reisegods, for eksempel frakt av rullestol. Utgiftene dekkes bare hvis det var nødvendig å ha med utstyret til behandlingen. Behandleren din må dokumentere dette behovet. Dokumentasjon på utgiftene må også legges ved.</p>    \n\n<h3>Ekstra rengjøring av bil</h3>     \n<p> Du kan ha rett til å få dekket utgifter til innvendig rengjøring av bil eller drosje etter en pasientreise. Behandleren din må dokumentere dette behovet. Dokumentasjon på utgiftene må også legges ved. </p>    \n\n<h3>Tapt arbeidsinntekt og dokumentert yrkesskade</h3>     \n<p> Hvis du reiste til behandling på grunn av yrkesskade, kan du ha rett til å få dekket tapt arbeidsinntekt. Du må legge ved dokumentasjon på behandling av yrkesskaden, vedtak på yrkesskaden og dokumentasjon på tapt arbeidsinntekt. </p>"}
  */
